import { useEffect, useState, useRef } from "react";
import * as tt from "@tomtom-international/web-sdk-maps";

function App() {
  const mapElement = useRef()
  const [map, setMap] = useState({})

  useEffect(() => {
    let map = tt.map({
      key: process.env.REACT_APP_TOMTOM_API_KEY,
      container: "map",
    })
    setMap(map)
  } , [])

  return (
    <div className="App">
      <div id="map"></div>

      <button onClick={() => {
        map.setCenter({ lat: 52.370216, lng: 4.895168 })
        map.setZoom(14)
      } }>
        Center map
      </button>














    </div>
  );
}

export default App;
